import React from 'react';
import './HamidContact.css';
import hamid from './images/hamid.jpg';

const HamidContact = () => {
  return (
    <div className='hamid'>
      <div className='content'>
        <img className='pfp' src={hamid} alt='Hamid Timorabadi'></img>
      </div>
    </div>
  )
}

export default HamidContact
